import React from 'react'

const Footer = () => {
    return(
        <footer className="ui inverted" style={{ height:"60px",paddingTop:"25px"}}>
            <p style={{color: "white", marginLeft:"10px", marginBottom: "15px"}}>Not an official Space X Website.Using the Space X API</p>
        </footer>
    )
}

export default Footer
